(function (Scratch) {
    "use strict";

    const vm = Scratch.vm;
    const runtime = vm.runtime;

    const blockIMGs = ["data:image/png;base64,", "data:image/png;base64,"];
    let blockIMG = blockIMGs[0];

    function combinePaths(svg) {
        const parser = new DOMParser();
        const svgDoc = parser.parseFromString(svg, "image/svg+xml");
        const pathElements = svgDoc.querySelectorAll("path");
        let combinedPathData = "";
        pathElements.forEach(path => combinedPathData += path.getAttribute("d"));
        const combinedPath = document.createElementNS("http://www.w3.org/2000/svg", "path");
        combinedPath.setAttribute("d", combinedPathData);
        return combinedPath.getAttribute("d");
    }

    let hiddenBlocks = [];
    runtime.on("BEFORE_EXECUTE", () => {
        for (var i = 0; i < hiddenBlocks.length; i++) {
            hiddenBlocks[i].setAttribute("opacity", 0);
        }
    });

    class SPjokeExt {
        getInfo() {
            return {
                id: "SPjokeExt",
                name: "Aewsome Extensoin",
                color1: "#000000",
                color2: "#000001",
                color3: "#ffffff",
                menuIconURI: blockIMG,
                blocks: [
                    { blockType: Scratch.BlockType.LABEL, text: "Right-Click to Hide Blocks!" },
                    {
                        opcode: "bestModBlock",
                        blockType: Scratch.BlockType.REPORTER,
                        text: "What is the best mod?"
                    },
                    {
                        func: "updateImg",
                        blockType: Scratch.BlockType.BUTTON,
                        text: "swap image"
                    },
                    {
                        opcode: "setColor",
                        blockType: Scratch.BlockType.COMMAND,
                        text: "set my block color to [COLOR]",
                        arguments: {
                            COLOR: {
                                type: Scratch.ArgumentType.COLOR
                            }
                        }
                    },
                    {
                        opcode: "setSVG",
                        blockType: Scratch.BlockType.REPORTER,
                        text: "set my block shape to svg [SVG]",
                        allowDropAnywhere: true,
                        arguments: {
                            SVG: {
                                type: Scratch.ArgumentType.STRING,
                                defaultValue: "<svg/>"
                            }
                        }
                    },
                    "---",
                    {
                        opcode: "repeatNega",
                        blockType: Scratch.BlockType.LOOP,
                        text: "repeat -[NUM]",
                        arguments: {
                            NUM: {
                                type: Scratch.ArgumentType.NUMBER,
                                defaultValue: 10
                            }
                        }
                    },
                    "---",
                    {
                        opcode: "isThing",
                        blockType: Scratch.BlockType.BOOLEAN,
                        text: "is [PERSON] a goober?",
                        arguments: {
                            PERSON: {
                                type: Scratch.ArgumentType.STRING,
                                menu: "PEOPLE"
                            }
                        }
                    },
                ],
                menus: {
                    PEOPLE: {
                        acceptReporters: true,
                        items: ["JeremyGamer13", "SharkPool", "GSA", "GarboMuffin", "LilyMakesThings", "Ashimee"]
                    }
                }
            };
        }

        bestModBlock() { return "PenguinMod" }

        updateImg() {
            if (blockIMG === blockIMGs[0]) blockIMG = blockIMGs[1];
            else blockIMG = blockIMGs[0];
            document.getElementById("SPimageThing").innerHTML = `<svg xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink" width="0" height="0"><defs>
        <pattern id="SPjokeExt-PAT1" patternUnits="userSpaceOnUse" width="50" height="50">
          <image xlink:href="${blockIMG}" x="0" y="0" width="50" height="50" />
        </pattern>
        </defs></svg>`;
        }

        setColor() { return }

        setSVG(args, util) {
            try {
                const path = combinePaths(args.SVG);
                const myID = ScratchBlocks.mainWorkspace.getBlockById(util.thread.isCompiled ? util.thread.peekStack() : util.thread.peekStackFrame().op.id);
                if (path) myID.svgPath_.setAttribute("d", path);
            } catch { }
        }

        repeatNega(args, util) {
            const times = -Math.round(Scratch.Cast.toNumber(args.NUM));
            if (typeof util.stackFrame.loopCounter === "undefined") util.stackFrame.loopCounter = times;
            util.stackFrame.loopCounter--;
            if (util.stackFrame.loopCounter >= 0) util.startBranch(1, true);
        }

        isThing(args) {
            const person = args.PERSON;
            if (person === "SharkPool" || person === "GarboMuffin") return false;
            else return true;
        }
    }

    function addPattern() {
        var grad1 = document.createElement("div");
        grad1.id = "SPimageThing";
        grad1.innerHTML = `<svg xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink" width="0" height="0"><defs>
      <pattern id="SPjokeExt-PAT1" patternUnits="userSpaceOnUse" width="50" height="50">
        <image xlink:href="${blockIMG}" x="0" y="0" width="50" height="50" />
      </pattern>
      </defs></svg>`;
        document.body.appendChild(grad1);
    }
    if (typeof scaffolding === "undefined") addPattern();

    function documentChangedCallback(mutationsList, observer) {
        for (const mutation of mutationsList) {
            if (mutation.type === "childList") {
                const targetNode = Array.from(mutation.addedNodes).find(node => node.classList && node.classList.contains("goog-menu") && node.classList.contains("goog-menu-vertical") && node.classList.contains("blocklyContextMenu"));
                if (targetNode && ScratchBlocks.selected !== null) {
                    const newItem = document.createElement("div");
                    newItem.classList.add("goog-menuitem", "sa-blockly-menu-item-border");
                    newItem.addEventListener("mouseenter", function () { newItem.classList.add("goog-menuitem-highlight") });
                    newItem.addEventListener("mouseleave", function () { newItem.classList.remove("goog-menuitem-highlight") });

                    newItem.setAttribute("role", "menuitem");
                    newItem.id = ":99"; newItem.style.userSelect = "none";
                    newItem.style.paddingTop = "2px"; newItem.style.borderTop = "1px solid var(--ui-black-transparent)";
                    newItem.innerHTML = `<div class="goog-menuitem-content" style="user-select: none;">Hide</div>`;
                    newItem.addEventListener("click", handleClick);
                    const thirdChild = targetNode.children[2];
                    thirdChild.parentNode.insertBefore(newItem, thirdChild.nextSibling);
                }
            }
        }
        const workspace = ScratchBlocks.mainWorkspace;
        var elements = document.querySelectorAll("g[data-category=\"Aewsome Extensoin\"] path");
        var pathElements = document.querySelectorAll("g[data-category=\"Aewsome Extensoin\"] path");
        pathElements.forEach(function (pathElement) {
            const opcode = pathElement.parentNode.getAttribute("data-id");
            const block = workspace.getBlockById(opcode);
            if (block && block.type !== "SPjokeExt_setColor") {
                var currentFill = pathElement.getAttribute("fill");
                var newFill = currentFill.replace(/#000000/g, "url(#SPjokeExt-PAT1)");
                pathElement.setAttribute("fill", newFill);
            } else if (block) {
                block.setColour(block.inputList[0].sourceBlock_.childBlocks_[0].colour_);
            }
        });
    }
    if (typeof scaffolding === "undefined") {
        var observer = new MutationObserver(documentChangedCallback);
        var observerConfig = { childList: true, subtree: true };
        observer.observe(document.documentElement, observerConfig);
    }

    function handleClick(event) {
        hiddenBlocks.push(ScratchBlocks.selected.svgGroup_);
        event.target.removeEventListener("click", handleClick);
        ScratchBlocks.selected = null;
        const item = event.currentTarget.parentNode;
        item.parentNode.removeChild(item);
    }

    Scratch.extensions.register(new SPjokeExt());
})(Scratch);